import classes from './Experiences.module.css';
import Container from 'react-bootstrap/esm/Container';

const Experiences = () => {
    return ( 
        <section className={classes.experiences}>
            <Container>
                <h3 className={classes.experiences__header}>Experiences</h3>
                <Container>
                    <Col sm={10}>
                        <h6>Software Engineer Intern</h6>
                    </Col>
                </Container>
            </Container>
        </section>
     );
}

export default Experiences;
